import Paper from '@material-ui/core/Paper';
import {createStyles, makeStyles, Theme} from '@material-ui/core/styles';
import React from 'react';
import AnglePie from './donutChart';
import TinyAreaChart from './TinyAreaChart';
import TineBarChart from './TinyBarChart';
import TinyLineChart from './TinyLineChart';

export type SmallCardLayoutProps={
  tinyLineChartData?:any
   tinyBarChartData?:any
   tinyAreaChartData:any
   AnglePieData:any
}



const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      '& > *': {
        margin: "38px",
        width: "350px",
        height: "180px",
        paddingTop:"35px",
        borderRadius:"5px"
      },
    },
  }),
);

export default function SimplePaper(props: SmallCardLayoutProps) {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      { props?.tinyLineChartData ?
      <Paper elevation={10}
      style={{
        backgroundColor:"white",
        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}><TinyLineChart
      tinyLineChartData={props?.tinyLineChartData}/></Paper> :null }

      <Paper elevation={10}
        style={{
        backgroundColor:"white",

        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}> <TinyAreaChart
      tinyAreaChartData={props?.tinyAreaChartData}/></Paper>

<Paper elevation={10}
        style={{
        backgroundColor:"white",

        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}> <TineBarChart
     tinyBarChartData={props?.tinyBarChartData}/></Paper>
<Paper elevation={10}
        style={{
        backgroundColor:"white",

        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}> <AnglePie
      AnglePieData={props?.AnglePieData}/></Paper>


    </div>
  );
}
